  render(){

    return(
      <div id="Vendor-collection">
       { this.props.Vendors.Vendors.map((vendor)=>{ 
         return < VendorCard Vendorinfo={Vendor}/>
          })}
      </div>
    );
  }
}


export default VendorContainer;
